    false,nt"url": null,nt"notes": "NCEI Accession 0152496 includes physical,
    profile and underway data collected aboard the MELVILLE during cruise MV1309 in
    the North Pacific Ocean from 2013-07-15 to 2013-07-30. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
    ADCP, CTD and GPS. These data were collected by Uwe Send of University of California
    - San Diego; Scripps Institution of Oceanography as part of Ocean Observatories
    Initiative (OOI): Station Papa Array, Leg 1. The Lamont-Doherty Earth Observatory
    (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling Deck to
    Repository (R2R) program.nnThe ADCP data represent the raw and automated processed
    data set. Post processed quality assessed data are not available in this accession.",nt"license_title":
